import './Profile.css';
import React from 'react';
import { instanceAxs } from '../../../config/api.js';

class Profile extends React.Component {

    constructor(props){
        super(props);
        this.state = {
            profileImgLink: '',
            isLoading: true
        }
    }


    getProfileImage = () => {
        instanceAxs.get('/profile/getprofileimg').then(response => {
            console.log(response)
        })
        .catch(error => {
            console.log(error)
        })
    }

    componentDidMount() {
        this.getProfileImage()
    }

    render() {
        return(
            <div>
                {!this.state.isLoading ? 
                <div></div>
                :
                <p>Loading</p>}
            </div>         
        )
    }
}

export default Profile;
